message:
Adicionado e corrigido comentários para melhor compreensão da classe;
Adicionado melhorias no carregamento dos plugins, onde as páginas agora recebem a string file:/ para suportar modo desktop;
Adicionado método stático para retornar o diretório dos plugins;
Adicionado método para salvar os dados dos plugins, listeners e versão do app para reduzir o length do método loadPlugins.

Atualizado nome de classe Emile para App;
Adicionado objeto como módulo qml através de qmlRegisterType para uso de requisições http;
Atualizado conexão entre o objeto app e slot no main;
